package com.leetcode;

import java.util.LinkedList;
import java.util.Queue;

public class DotaSenate {
    public String predictPartyVictory2(String senate) {
        Queue<Character> senators = new LinkedList<>();
        for (char s : senate.toCharArray()) {
            senators.offer(s);
        }

        while (banSenator(senators)) {
        }
        return senators.peek() == 'R' ? "Radiant" : "Dire";
    }

    private boolean banSenator(Queue<Character> senators) {
        int senatorsCount = senators.size();
        char currentParty = senators.peek();
        boolean banned = false;
        for (int i = 0; i <= senatorsCount; i++) {
            char senator = senators.poll();
            if (banned || senator == currentParty) {
                senators.offer(senator);
            } else {
               banned = true;
            }
        }
        return banned;
    }

    public String predictPartyVictory(String senate) {
        int senatorsCount = senate.length();
        Queue<Integer> radiants = new LinkedList<>();
        Queue<Integer> dires = new LinkedList<>();
        for (int i=0; i<senatorsCount; i++ ) {
            if (senate.charAt(i) == 'R') {
                radiants.offer(i);
            }  else {
                dires.offer(i);
            }
        }
        while (!radiants.isEmpty() && !dires.isEmpty()) {
            int r = radiants.poll();
            int d = dires.poll();
            if (r < d) {
                radiants.offer(r + senatorsCount);
            } else {
                dires.offer(d + senatorsCount);
            }
        }

        return dires.isEmpty() ? "Radiant" : "Dire";
    }



    public static void main(String[] args) {
        DotaSenate senate = new DotaSenate();
        System.out.println(senate.predictPartyVictory("RD"));
        System.out.println(senate.predictPartyVictory("RDD"));
        System.out.println(senate.predictPartyVictory("RRDDD"));
        System.out.println(senate.predictPartyVictory(""));
    }
}
